DROP TABLE IF EXISTS `tbl_beli_detail`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tbl_beli_detail` (
  `id_beli_detail` int(8) NOT NULL AUTO_INCREMENT,
  `no_beli` varchar(25) NOT NULL,
  `kd_barang` varchar(25) NOT NULL,
  `qty_beli` decimal(19,4) DEFAULT '0.0000',
  `harga_beli` decimal(19,4) DEFAULT '0.0000',
  `total_beli` decimal(19,4) DEFAULT '0.0000',
  `kd_perusahaan` varchar(15) NOT NULL,
  `user_created` varchar(15) DEFAULT NULL,
  `date_created` datetime DEFAULT NULL,
  `user_modified` varchar(15) DEFAULT NULL,
  `date_modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id_beli_detail`),
  KEY `nobukti` (`no_beli`),
  KEY `kodebarang` (`kd_barang`),
  CONSTRAINT `tbl_beli_detail_ibfk_1` FOREIGN KEY (`no_beli`) REFERENCES `tbl_beli_main` (`no_beli`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_beli_detail_ibfk_2` FOREIGN KEY (`kd_barang`) REFERENCES `tbl_barang` (`kd_barang`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1347 DEFAULT CHARSET=utf8;
